import React from 'react';
import YouTube from 'react-youtube';

const HeaderMovie = () => {
    return (
        <div>
            <YouTube
        videoId="qT_fjEgPsaA"
        opts={{
          width: "100%",
          height: "100%",
          playerVars: {
            autoplay: 0, //자동재생 O
            modestbranding: 1, // 컨트롤 바에 youtube 로고를 표시하지 않음
          },
        }}
        //이벤트 리스너
        onEnd={(e) => {
          e.target.stopVideo(0);
        }}
      />
        </div>
    );
};

export default HeaderMovie;
